      tag_title_suffix = site.config[&#39;tag_title_suffix&#39;] || &#39;&amp;amp;#8211;&#39;
      self.data[&#39;title&#39;] = &quot;#{tag_title_prefix}#{tag}&quot;
      self.data[&#39;description&#39;] = &quot;An archive of posts tagged #{tag}.&quot;
    end
  end
